import React from 'react';
import Login from './components/login';
import Notepad from './components/notepad';
import './App.css';
import { Router } from 'react-router-dom';

export default function App() {
  return (
    <Router>
      <div>
        <Route>
          < Login />
        </Route>
        <Route>
          < Notepad />
        </Route>
     </div>
    </Router>

  );
}
